import * as React from "react";
import Box from "@mui/material/Box";
import Drawer from "@mui/material/Drawer";
import Button from "@mui/material/Button";
import List from "@mui/material/List";
import { GrFilter } from "react-icons/gr";
export default function TemporaryDrawer() {
  const [state, setState] = React.useState({
    right: false,
  });

  const toggleDrawer = (anchor, open) => setState({ ...state, [anchor]: open });

  return (
    <div>
      <React.Fragment key={"filters"}>
        <div
          className="Projects_btn_div"
          onClick={toggleDrawer("filters", true)}
        >
          <p> {"filters"}</p>
          <span>
            <GrFilter />
          </span>
        </div>
        <Drawer
          anchor="right"
          open={state["filters"]}
          onClose={toggleDrawer("filters", false)}
        >
          <Box sx={{ width: 250 }} role="presentation">
            <List>2</List>
            <List onClick={toggleDrawer(anchor, false)}>close</List>
          </Box>
        </Drawer>
      </React.Fragment>
    </div>
  );
}
